import React from "react";

const SocialLinks = (props) => {
  props.social.map((soc, index) => (
    <li>
      <a href={props.link}>{props.mediaName}</a>
    </li>
  ));
  return (
    <div>
      <h3>Contact With Me</h3>
      <ul>
        <li>
          <a href={props.link}>{props.mediaName}</a>
        </li>
      </ul>
    </div>
  );
};

export default SocialLinks;
